import Banner from "./components/Banner";
import { useState } from "react";
import MainScreen from "./screens/MainScreen";

const App = () => {
  const [token, setToken] = useState(null);

  return (
    <div className="App">
      <Banner />
      <MainScreen
        token={token}
        setToken={setToken}
      />
    </div>
  );
};

export default App;
